[asy]
unitsize(3 cm);

pair A, O, T;

real func (real x) {
  return ((x - 1)*(x - 2));
}

A = (1.5,-0.4);
O = (0,0);
T = intersectionpoint(Circle(A,abs(A - (1,0))),arc(A/2,abs(A)/2,0,90));

draw(graph(func,0.5,2.5));
draw((-0.5,0)--(2.5,0));
draw((0,-1)--(0,1));
draw(Circle(A,abs(A - (1,0))));
draw(O--T);

label("$t$", T/3, N);

dot(T);
